import React from 'react';

export const StationDetails = ({ name, elevation, temp, newSnow, snowDepth }) => {
  return (
    <div>
      <h>{name}</h>
      <h2>{elevation}</h2>
      <h2>Current Temp: {temp} {String.fromCharCode(176)}C</h2>
      <h2>New Snow Past 24hr: {newSnow} cm</h2>
      <h2>Snow Depth: {snowDepth} cm</h2>
    </div>
  )
}
